import React, { useState, useCallback } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import Header from './components/Header';
import Footer from './components/Footer';
import PatientEntry from './components/PatientEntry';
import NurseApproval from './components/NurseApproval';
import DoctorPage from './components/DoctorPage';
import { TriageProvider, useTriageContext } from './contexts/TriageContext';
import { TriageState, TriageInput } from './types/TriageTypes';
import { triageApi } from './services/triageApi';

function AppContent() {
  const { patientData, setPatientData, triageResult, setTriageResult, nurseNotes, setNurseNotes, clearData } = useTriageContext();
  
  const [triageState, setTriageState] = useState<TriageState>({
    caseId: null,
    currentQuestion: null,
    remainingQuestions: 0,
    triage: null,
    filePath: null,
    isLoading: false,
    error: null,
  });

  const processQuestions = useCallback((questions: any) => {
    if (Array.isArray(questions)) {
      return questions;
    }
    if (questions && typeof questions === 'object') {
      const result: string[] = [];
      if (questions.primary) result.push(...questions.primary);
      if (questions.secondary) result.push(...questions.secondary);
      return result;
    }
    return [];
  }, []);

  const handleStartTriage = useCallback(async (input: TriageInput) => {
    setTriageState(prev => ({ ...prev, isLoading: true, error: null }));
    
    try {
      const response = await triageApi.startTriage(input);
      const questions = processQuestions(response.questions_to_ask_next);
      
      setTriageState(prev => ({
        ...prev,
        caseId: response.case_id,
        currentQuestion: questions[0] || null,
        remainingQuestions: questions.length - 1,
        triage: response.triage,
        filePath: response.file_path,
        isLoading: false,
        error: null,
      }));
      
      return response; // Response'u döndür
    } catch (error: any) {
      setTriageState(prev => ({
        ...prev,
        isLoading: false,
        error: error.message,
      }));
      throw error;
    }
  }, [processQuestions]);

  const handleSendAnswer = useCallback(async (answer: string, skip: boolean = false) => {
    if (!triageState.caseId) return;

    setTriageState(prev => ({ ...prev, isLoading: true, error: null }));

    try {
      const currentQ = triageState.currentQuestion;
      const body = {
        answers: currentQ ? { [currentQ]: skip ? '' : answer } : undefined,
        done: false,
      };

      const response = await triageApi.sendAnswer(triageState.caseId, body);
      const questions = processQuestions(response.questions_to_ask_next);
      
      setTriageState(prev => ({
        ...prev,
        currentQuestion: questions[0] || null,
        remainingQuestions: questions.length - 1,
        triage: response.triage,
        filePath: response.file_path,
        isLoading: false,
        error: null,
      }));
    } catch (error: any) {
      setTriageState(prev => ({
        ...prev,
        isLoading: false,
        error: error.message,
      }));
      throw error;
    }
  }, [triageState.caseId, triageState.currentQuestion, processQuestions]);

  const handleDone = useCallback(async () => {
    if (!triageState.caseId) return;

    setTriageState(prev => ({ ...prev, isLoading: true, error: null }));

    try {
      const response = await triageApi.sendAnswer(triageState.caseId, { done: true });
      
      setTriageState(prev => ({
        ...prev,
        currentQuestion: null,
        remainingQuestions: 0,
        triage: response.triage,
        filePath: response.file_path,
        isLoading: false,
        error: null,
      }));
    } catch (error: any) {
      setTriageState(prev => ({
        ...prev,
        isLoading: false,
        error: error.message,
      }));
      throw error;
    }
  }, [triageState.caseId]);

  const handleReset = useCallback(() => {
    setTriageState({
      caseId: null,
      currentQuestion: null,
      remainingQuestions: 0,
      triage: null,
      filePath: null,
      isLoading: false,
      error: null,
    });
    clearData();
  }, [clearData]);

  const handlePatientStart = useCallback(async (data: any) => {
    try {
      setPatientData(data);
      
      // Gerçek API çağrısı
      const triageInput: TriageInput = {
        age: parseInt(data.age),
        sex: data.sex,
        complaint_text: data.complaint,
        pregnancy: data.pregnancy,
        chief: data.chief,
        vitals: data.vitals ? JSON.parse(data.vitals) : undefined
      };

      const response = await handleStartTriage(triageInput);
      
      // API'den gelen sonucu kullan
      setTriageResult(response.triage);
      setTriageState(prev => ({
        ...prev,
        triage: response.triage,
        caseId: response.case_id,
        isLoading: false,
        error: null
      }));
      
      // Navigate to nurse page
      window.location.href = '/nurse';
    } catch (error) {
      console.error('Error starting triage:', error);
      // Stay on patient page if there's an error
    }
  }, [handleStartTriage]);

  const handleNurseApprove = useCallback((notes: string) => {
    setNurseNotes(notes);
    window.location.href = '/doctor';
  }, []);

  const handleNurseReject = useCallback(() => {
    window.location.href = '/';
  }, []);

  const handleDoctorComplete = useCallback(() => {
    // Reset to start new assessment
    handleReset();
    window.location.href = '/';
  }, [handleReset]);

  return (
    <div className="App">
      <Router>
        <Header />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<PatientEntry onStartAssessment={handlePatientStart} />} />
            <Route 
              path="/nurse" 
              element={
                <NurseApproval
                  patientData={patientData}
                  triageResult={triageResult}
                  onApprove={handleNurseApprove}
                  onReject={handleNurseReject}
                />
              } 
            />
            <Route 
              path="/doctor" 
              element={
                <DoctorPage
                  patientData={patientData}
                  triageResult={triageResult}
                  nurseNotes={nurseNotes}
                  onComplete={handleDoctorComplete}
                />
              } 
            />
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </main>
        <Footer />
      </Router>
    </div>
  );
}

function App() {
  return (
    <TriageProvider>
      <AppContent />
    </TriageProvider>
  );
}

export default App;
